/**<p>Text transformations eliminate some of the unusual formatting that attackers use in web requests in an effort to bypass AWS WAF. If you specify a transformation, AWS WAF performs the transformation on <code>TargetString</code> before inspecting a request for a match.</p> <p><b>CMD_LINE</b></p> <p>When you're concerned that attackers are injecting an operating system commandline command and using unusual formatting to disguise some or all of the command, use this option to perform the following transformations:</p> <ul> <li>Delete the following characters: \ " ' ^</li> <li>Delete spaces before the following characters: / (</li> <li>Replace the following characters with a space: , ;</li> <li>Replace multiple spaces with one space</li> <li>Convert uppercase letters (A-Z) to lowercase (a-z)</li> </ul> <p><b>COMPRESS_WHITE_SPACE</b></p> <p>Use this option to replace the following characters with a space character (decimal 32):</p> <ul> <li>\f, formfeed, decimal 12</li> <li>\t, tab, decimal 9</li> <li>\n, newline, decimal 10</li> <li>\r, carriage return, decimal 13</li> <li>\v, vertical tab, decimal 11</li> <li>non-breaking space, decimal 160</li> </ul> <p><code>COMPRESS_WHITE_SPACE</code> also replaces multiple spaces with one space.</p> <p><b>HTML_ENTITY_DECODE</b></p> <p>Use this option to replace HTML-encoded characters with unencoded characters. <code>HTML_ENTITY_DECODE</code> performs the following operations:</p> <ul> <li>Replaces <code>(ampersand)quot;</code> with <code>"</code></li> <li>Replaces <code>(ampersand)nbsp;</code> with a non-breaking space, decimal 160</li> <li>Replaces <code>(ampersand)lt;</code> with a "less than" symbol</li> <li>Replaces <code>(ampersand)gt;</code> with <code>></code></li> <li>Replaces characters that are represented in hexadecimal format, <code>(ampersand)#xhhhh;</code>, with the corresponding characters</li> <li>Replaces characters that are represented in decimal format, <code>(ampersand)#nnnn;</code>, with the corresponding characters</li> </ul> <p><b>LOWERCASE</b></p> <p>Use this option to convert uppercase letters (A-Z) to lowercase (a-z).</p> <p><b>URL_DECODE</b></p> <p>Use this option to decode a URL-encoded value.</p> <p><b>NONE</b></p> <p>Specify <code>NONE</code> if you don't want to perform any text transformations.</p>
