/**<p>Within the portion of a web request that you want to search (for example, in the query string, if any), specify where you want AWS WAF to search. Valid values include the following:</p> <p><b>CONTAINS</b></p> <p>The specified part of the web request must include the value of <code>TargetString</code>, but the location doesn't matter.</p> <p><b>CONTAINS_WORD</b></p> <p>The specified part of the web request must include the value of <code>TargetString</code>, and <code>TargetString</code> must contain only alphanumeric characters or underscore (A-Z, a-z, 0-9, or _). In addition, <code>TargetString</code> must be a word, which means one of the following:</p> <ul> <li><code>TargetString</code> exactly matches the value of the specified part of the web request, such as the value of a header.</li> <li><code>TargetString</code> is at the beginning of the specified part of the web request and is followed by a character other than an alphanumeric character or underscore (_), for example, <code>BadBot;</code>.</li> <li><code>TargetString</code> is at the end of the specified part of the web request and is preceded by a character other than an alphanumeric character or underscore (_), for example, <code>;BadBot</code>.</li> <li><code>TargetString</code> is in the middle of the specified part of the web request and is preceded and followed by characters other than alphanumeric characters or underscore (_), for example, <code>-BadBot;</code>.</li> </ul> <p><b>EXACTLY</b></p> <p>The value of the specified part of the web request must exactly match the value of <code>TargetString</code>.</p> <p><b>STARTS_WITH</b></p> <p>The value of <code>TargetString</code> must appear at the beginning of the specified part of the web request.</p> <p><b>ENDS_WITH</b></p> <p>The value of <code>TargetString</code> must appear at the end of the specified part of the web request.</p>
